import React, { Component } from "react";
import { Link } from "react-router-dom";

const PortfolioListContent = [
  {
    image: "image-1",
    category: "App mobile Front-end (React-Native)",
    title: "BarTap",
  },
  {
    image: "image-2",
    category: "Site internet (ReactJS) avec BDD et API",
    title: "Marvel",
  },
  {
    image: "happycowthumbnail.png",
    category: "App mobile (React-Native) avec API",
    title: "Happy Cow",
    details:
      "http://drive.google.com/file/d/1RjdoJOXhNIQmyDA-73YdcGSNLPTAXcey/view?usp=drive_link",
  },
];

class PortfolioList extends Component {
  render() {
    const { column, styevariation } = this.props;
    const list = PortfolioListContent.slice(0, this.props.item);
    return (
      <React.Fragment>
        {list.map((value, index) => (
          <div className={`${column}`} key={index}>
            <div className={`portfolio ${styevariation}`}>
              <div className="thumbnail-inner">
                {value.details ? (
                  <>
                    <div className="thumbnailService"></div>
                    <div className={`bg-blr-image ${value.image}`}></div>
                  </>
                ) : (
                  <>
                    <div className={`thumbnail ${value.image}`}></div>
                    <div className={`bg-blr-image ${value.image}`}></div>
                  </>
                )}
              </div>
              <div className="content">
                <div className="inner">
                  <p>{value.category}</p>
                  <h4>
                    <a href="/portfolio-details">"{value.title}"</a>
                  </h4>
                  {!value.details ? null : (
                    <div className="portfolio-button">
                      <a className="rn-btn" href={value.details}>
                        Voir Details
                      </a>
                    </div>
                  )}
                </div>
              </div>
              <Link className="link-overlay" to="/portfolio-details"></Link>
            </div>
          </div>
        ))}
      </React.Fragment>
    );
  }
}
export default PortfolioList;
